import React, { useState } from "react";
import {
  List,
  ListItem,
  ListItemText,
  ListItemSecondaryAction,
  IconButton,
} from "@mui/material";
import DeleteIcon from "@mui/icons-material/Delete";

const WishlistList = () => {
  const [items, setItems] = useState([
    { id: 1, firstname: "Julian", lastname: "Item 1", year: 2022 },
    { id: 2, firstname: "Item 2", lastname: "Item 1", year: 2023 },
    { id: 3, firstname: "Item 3", lastname: "Item 1", year: 2024 },
  ]);

  const handleDelete = (itemId) => {
    setItems((prevItems) => prevItems.filter((item) => item.id !== itemId));
  };

  return (
    <List>
      {items.map((item) => (
        <ListItem key={item.id}>
          <ListItemText
            primary={`${item.name} - ${item.year}`}
            // Add more ListItemText properties as needed
          />
          <ListItemSecondaryAction>
            <IconButton
              edge="end"
              aria-label="delete"
              onClick={() => handleDelete(item.id)}
            >
              <DeleteIcon />
            </IconButton>
          </ListItemSecondaryAction>
        </ListItem>
      ))}
    </List>
  );
};

export default WishlistList;
